import React from "react";
import Card from './Card';
import Sdata from "./Sdata";
import You from './You';

function CardData(){
    const value="yo"
    if(value==="you"){
        return <You/>;
    }else{
        return <>
            {
                Sdata.map((Sdata,index) => (
                    <Card
                        key={index}
                        imgLink={Sdata.imgLink}
                        title={Sdata.title}
                        text={Sdata.text}
                        link_text={Sdata.link_text}
                        link={Sdata.link}
                    />
                ))
            }
        </>
    }
}

function App() {
    return (
        <>
            <h1>Top Netflix Suggestions</h1>
            <CardData/>
        </>
    );
}
export default App;
